import React from 'react';
import { Router, Route, Switch, withRouter } from 'react-router-dom';
import Blue from './blue';
import Green from './green';
import Red from './red';
import Purple from './purple';

function App() {
    return (
        <div>
            <h1>Hello World</h1>
            <Route path="/red" component={Red} />
        </div>
    );
}

export default App;
